const EMPTY_STATE_DATA = {
  NODATA: {
    SVG: NoTaskSVG,
    title: 'Oops!',
    description: 'It looks like you havent added any tasks yet. Click on the Add Task button to add a new task'
  },
  DONE: {
    SVG: AllDoneSVG,
    title: 'All Done!',
    description: 'It looks like you finished all your tasks. Click on the Add Task button to add a new task'
  }
}

const Layout = ({ SVG, title, description }) => (
  <div className="flex flex-col items-center justify-center mt-8">
    <SVG/>
    <div className="mt-6">
      <h2 className="text-lg font-medium text-center text-gray-800">{title}</h2>
      <p className="w-2/3 mx-auto text-sm leading-relaxed text-center text-gray-600">{description}</p>
    </div>
  </div>
)

const EmptyState = ({ tasks }) => {
  
  const isDone = tasks?.every(task => task.completed);
  const isNil = tasks?.length === 0;

  if (isNil) {
    return (
      <Layout
        {...EMPTY_STATE_DATA['NODATA']}
      />
    )
  } else if (isDone) {
    return (
      <Layout
        {...EMPTY_STATE_DATA['DONE']}
      />
    )
  }
  else return null;
}

export default EmptyState
